import React from 'react'
import styled from 'styled-components'

 export const Sidebar = styled.div`
    width: 250px;
    position: fixed;
    top: 0;
    left: 0;
    height: 100vh;
    z-index: 999;
    background: #3256D4;
    color: #fff;
    transition: all 0.3s;

`

function AdminPanel() {
    return (
        <Sidebar>
            <div>
                <h2>Admin Panel</h2>
            </div>
        </Sidebar>
    )
}

export default AdminPanel
